    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Admin - Incyte{% endblock %}
{% block stylesheets %}
    {{ parent() }}
    {{ encore_entry_link_tags('admin') }}
{% endblock %}
{% block body %}

    {% include '/admin/congres/_navbar.html.twig' %}
    <style>label.required{display: contents}</style>
    <div class=\"container\">
        <h3 class=\"pb-4\"><a class=\"pr-3\" href=\"{{ path('admin_congres_user', {id: congres.id}) }}\">&#8249;</a>Editer un contact</h3>
        <div class=\"row bg-white p-3 shadow-lg\">
            <div class=\"col-12\">
                {% for message in app.flashes('sucess') %}
                    <div class=\"alert alert-success\">
                        {{ message }}
                    </div>
                {% endfor %}

                {{ form_start(form) }}
                <div class=\"my-custom-class-for-errors\">
                    {{ form_errors(form) }}
                </div>

                <div class=\"row\">
                    <div class=\"col\">
                        {{ form_row(form.lastname) }}
                        {{ form_row(form.job) }}
                        {{ form_row(form.email) }}
                    </div>
                    <div class=\"col\">
                        {{ form_row(form.firstname) }}
                        {{ form_row(form.localisation) }}
                        {{ form_row(form.phone) }}
                    </div>
                </div>
                {{ form_row(form.about) }}
                {{ form_row(form.img, {'required': false}) }}
                <img src=\"{{ asset('uploads/img/user/') }}{{ user.img }}\" class=\"mb-3\" width=\"100px\">

                {{ form_row(form.categoryUsers) }}
                {{ form_row(form.reasons) }}

                {{ form_end(form) }}
            </div>
        </div>
    </div>

{% endblock %}

", "admin/user/editUser.html.twig", "/var/www/vhosts/evenements-incyte.com/httpdocs/templates/admin/user/editUser.html.twig");
